import logo from '../../img/logo.svg'
import { Link } from 'react-router-dom';
import { useDarkModeContext } from "../../context/DarkModeContext";
const Logo = () => {
    const {darkMode} = useDarkModeContext()

    return (
        <>
        <Link className="navbar-brand d-flex align-content-center" to={"/"}> 
        <img className={`align-self-center  align-text-center d-inline-block ${darkMode ? 'hide bg-white' : 'show bg-white'}`} src={logo} alt={"logo"} />
                    <span className="logoText align-self-center d-inline-block align-text-center">Nina's shop</span>
        </Link>

        </>
    );
}

export default Logo;
